$(function() {

  $('.dropdown-button').dropdown({
    belowOrigin: true,
    constrain_width: false
  })

  $('.portfolio-area').ready(function() {

    renderPortfolioSection();

    var routes = [
      "#overview-tab",
      "#all-stocks-tab",
      "#analysis-tab",
      "#comparison-tab",
      "#trades-tab"    
    ];

    $('.portfolio-nav').on('click','a', function(e) {
      if ($(this).closest('li').hasClass('active')) {
        e.preventDefault();
        return false;
      };
    })

    $(window).on('hashchange', function (event) {
      if (routes.includes(location.hash) && !$(location.hash).hasClass('active')) 
        renderPortfolioSection();
      return false;
    });

  });

  return false; 

})

function renderPortfolioSection() {
  if (location.hash !== "") $(location.hash).siblings().removeClass('active');

  var preloader = $("#preloader").html();
  $("div.portfolio-content").append(preloader);

  setTimeout(function() {
    $('.portfolio-content .preloader-wrapper').remove();
    if (location.hash == "") $('#overview-tab, li:has(a[href="#overview-tab"])').addClass('active');
    if (location.hash !== "") {
      $(location.hash).addClass('active') ;
      $('[href="' + location.hash + '"]').closest('li').addClass('active').siblings().removeClass('active');
    };
    $('.portfolio-content div.active').trigger('tabactive');
  }, 500);

};

function createChartArray(valuations) {
  if (Array.isArray(valuations)) {
    var dailyDatePrice = [];
    $.each(valuations,function(idx,valuation) {
      dailyDatePrice.push([Date.parse(valuation[0]),parseInt(valuation[1])]);
    });
    return dailyDatePrice.sort(function(a,b){return a[0]-b[0]});
  }
  var dailyDatePrice = {};
  var user = [];
  var monkey = [];
  var index = [];

  $.each(valuations['user'],function(idx,valuation) {
    user.push([Date.parse(valuation[0]),parseInt(valuation[1])]);
  });
  $.each(valuations['monkey'],function(idx,valuation) {
    monkey.push([Date.parse(valuation[0]),parseInt(valuation[1])]);
  });
  $.each(valuations['index'],function(idx,valuation) {
    index.push([Date.parse(valuation[0]),parseInt(valuation[1])]);
  });

  user.sort(function(a, b){return a[0]-b[0]}); 
  monkey.sort(function(a,b){return a[0]-b[0]});
  dailyDatePrice['User'] = user;
  dailyDatePrice['Monkey'] = monkey;
  dailyDatePrice['Index'] = index;
  return dailyDatePrice;

}

function renderTimeChart(chartArrays, container, chartName, seriesName) {
  if ((Array.isArray(chartArrays) && chartArrays.length < 2) || (chartArrays['User'] != undefined && chartArrays['User'].length < 2)) {
    container.height(0);
    return false;
  }

  options = {
    colors: ["#283593","#ad1457","#1976d2","#4fc3f7","#009688","#757575","#212121"],
    rangeSelector : {
      selected : 1
    },
    title : {
      text : chartName,
      style: {
        color: "#009688",
        fontSize: "1.2rem"
      }
    },
    legend: {
      enabled:true
    }
  };
  var seriesOptions = [];

  if (Array.isArray(chartArrays)) {
    console.log(chartArrays);
    seriesOptions = [{
      name: 'Daily Trade Amount',
      data: chartArrays
    }]
  } else {
    var i = 0;
    $.each(chartArrays, function(key, arr) {
      seriesOptions[i] = {
        name: key,
        data: arr
      }
    i++;
    });
  };


  options.series = seriesOptions;

  container.highcharts('StockChart', options);
}

function align() {
  var preloader = $('.portfolio-content .preloader-wrapper');
  var parent = preloader.parent().last();
  var marginTop = (parent.height()-preloader.height())/2;
  var marginLeft= (parent.width()-preloader.width())/2;
  preloader.css('margin-top', marginTop).css('margin-left', marginLeft);
}
$(function() {


  var totalPortfolioValue = 0;
  var startingCapital = 1000000;

  var portfolioTableData = $('.new-portfolio-data tbody');
  portfolioTableData.children().each(function(idx,row) {
    var totalValue = calculateTotalShareValue(row);
    totalPortfolioValue += totalValue;
  });

  var serializedPortfolioData = {};
  // $('.new-portfolio').on('click','button.create-portfolio-btn', function(e) {
  //   var tradesData = []; 
  //   portfolioTableData.children('tr').each(function(idx,row) {
  //    var stock = {
  //     ticker: $(row).children('td.stock-ticker').text(),
  //     quantity: $(row).children('td.number-of-shares').children('input').val(),
  //     price: $(row).children('td.stock-price').text()
  //    };
  //    if (stock.quantity > 0) tradesData.push(stock);
  //   })
  //   var portfolioInformation = 
  //     {
  //     'name': $('#portfolio-name').text(),
  //     'cash': startingCapital - totalPortfolioValue,
  //     'value': totalPortfolioValue
  //     };
  //   serializedPortfolioData['info'] = portfolioInformation;
  //   serializedPortfolioData['trades'] = tradesData;
  //   $.ajax({
  //     url: "/api/portfolios",
  //     method: "POST",
  //     data: {'portfolio':JSON.stringify(serializedPortfolioData)},
  //     success: function(data) {
  //       console.log(data);
  //     }
  //   })
  // })

  $(window).on('keydown', function(e) {
    if (e.keyCode === 13) e.preventDefault();
    return;
  })

  $('button.create-portfolio-btn').bind('click', function(e) {
    if (totalPortfolioValue > 1000000) {
      e.preventDefault();
      return false;
    }
  })

  calculatePctOfTotal();

  $('span.equity-holdings').text("$"+ Math.floor(totalPortfolioValue).toLocaleString());
  $('span.cash-holdings').text("$" + Math.floor(startingCapital - totalPortfolioValue).toLocaleString());


  var previousValue;
  $('.new-portfolio-data tbody')
    .on('focus', '.number-of-shares > input', function() {
      previousValue = $(this).val();
    })
    .on('change','.number-of-shares > input', function() {
      var stockRow = $(this).parent().parent();
      calculateTotalShareValue(stockRow);
      var newValue = $(this).val();
      totalPortfolioValue += (newValue - previousValue) * $(this).parent().siblings('td.stock-price').text();
      if ($('div.toast')) $('div.toast').remove();
      calculatePctOfTotal();
      $('span.equity-holdings').text("$"+ Math.floor(totalPortfolioValue).toLocaleString());
      $('span.cash-holdings').text("$" + Math.floor(startingCapital - totalPortfolioValue).toLocaleString());
      if (totalPortfolioValue > 1000000) {
        $('span.cash-holdings').addClass('red-text accent-4');
        $(this).addClass('red lighten-3');
        var toastContent = $("<span>You do not have enough cash!</span>");
        if (Number(newValue) > Number(previousValue)) { 
          Materialize.toast(toastContent,4000);
        };
        $('.create-portfolio-btn').addClass('disabled');
      }  else {
        $('span.cash-holdings').removeClass('red-text accent-4');
        $(this).removeClass('red lighten-3');
        $('.create-portfolio-btn').removeClass('disabled');
      } 
      previousValue = newValue;
    })




  // prevents scrolling parent div when scrolled at the end of .new-portfolio-data
  var newPortfolio = $('.new-portfolio-data');

  newPortfolio.bind('mousewheel', function(e) {
    var height = newPortfolio.height();
    scrollHeight = newPortfolio.get(0).scrollHeight;
    if(this.scrollTop > (scrollHeight - height) && ( e.originalEvent.detail > 0 || e.originalEvent.wheelDelta < 0 )) {
      e.preventDefault();
    }
  });


  function calculateTotalShareValue(stockRow) {
    var numberOfShares = $(stockRow).children('td.number-of-shares').children('input').val();
    var sharePrice = $(stockRow).children('td.stock-price').text();
    var totalValue = isNaN(sharePrice) ? 0 : numberOfShares * sharePrice;
    $(stockRow).children('td.total-value').text(Math.round(totalValue, 2).toLocaleString());
    return totalValue;
  }

  function calculatePctOfTotal() {
    portfolioTableData.children().each(function(idx,row) {
      var numberOfShares = $(row).children('td.number-of-shares').children('input').val();
      var sharePrice = $(row).children('td.stock-price').text();
      var totalValue = isNaN(sharePrice) ? 0 : numberOfShares * sharePrice;
      var pctOfTotal = totalValue / totalPortfolioValue;
      $(row).children('td.pct-of-total').text(Math.round(pctOfTotal * 100, 0) + "%");
    });
  }


});
$(function() {

  $('#overview-tab').bind('tabactive',function() {
    var quotesRequest;
    var portfolioCash = parseInt($('#portfolio-holdings-chart').data('portfolio-cash'));
    var portfolioEquity = parseInt($('#portfolio-holdings-chart').data('portfolio-equity'));
    var portfolioValue = portfolioCash + portfolioEquity;
    var preloader = $("#preloader").html();
    $('#portfolio-overview-chart').append(preloader).trigger('preloading');
    $(this).bind('preloading', align());    

    valuationsRequest = $.ajax({
      url: "/api" + window.location.pathname,
      method: 'GET',
      data: {'request_type': 'historical_valuation', 'sector':'all'},
      contentType: 'JSON'
    })


    //potentially rewrite this as a named function
    valuationsRequest.then(function(valuations) {
      $("#portfolio-overview-chart .preloader-wrapper").remove();
      var chartArray = createChartArray(valuations);
      renderTimeChart(chartArray, $("#portfolio-overview-chart"), "Portfolio Performance Overview", 'Overall Value');
      renderHoldingsOverviewChart($("#portfolio-holdings-chart"));
    })

    function renderHoldingsOverviewChart(container) {
        container.highcharts({
            chart: {
                type: 'bar'
            },
            title: {
                text: 'Portfolio Holdings Overview',
                style: {
                  color: "#009688",
                  fontSize: "1.2rem"
                }
            },
            xAxis: {
                labels: {
                  enabled: false
                },
                minorTickLength: 0,
                tickLength: 0,
                categories: ["Portfolio Overview"]
            },
            yAxis: {
                min: 0,
                max: [portfolioValue],
                labels: {
                  enabled: false
                },
                title: {
                  text: null
                }

            },
            legend: {
                reversed: true,
                symbolWidth:50,
                align: 'center',
                labelFormatter: function() {
                  var valData = '$'+ this.yData[this.yData.length - 1].toLocaleString();
                  return this.name + " " + valData;
                }
            },
            plotOptions: {
                series: {
                    stacking: 'normal'
                }
            },
            series: [{
                name: 'Cash',
                data: [portfolioCash],
                pointWidth: 100
            }, {
                name: 'Equity',
                data: [portfolioEquity],
                pointWidth: 100
            }]
        });
    }
  })

})
$(function () {
  $('#analysis-tab')
    .bind('tabactive', function() {
      $('select').material_select();
      var sectorValueRequest = $.ajax({
        url:"/api" + window.location.pathname,
        method: 'GET',
        data: {'request_type':'current_valuation'},
        contentType: 'JSON',
        success: function(res) {
          console.log(res);
          renderSectorOverviewChart($('#sector-breakdown-chart'), res);
        }
      })
      selectSector();
      sectorOverviewChart();
    })
    .on('change','#sector-filter', function () {
      selectSector();
      sectorOverviewChart();
    })

    function sectorOverviewChart() {
        var activeSector = $('#sector-filter').val();
        var preloader = $("#preloader").html();
        $('#portfolio-sector-chart').append(preloader).trigger('preloading');
        var valuationsRequest = $.ajax({
          url: "/api" + window.location.pathname,
          method: 'GET',
          data: {'request_type': 'historical_valuation', 'sector':activeSector},
          contentType: 'JSON'
        });
        valuationsRequest.then(function(valuations) {
          $('#sector-overview-chart .preloader-wrapper').remove();
          var chartArray = createChartArray(valuations);
          renderTimeChart(chartArray, $("#sector-overview-chart"), activeSector+" Performance", 'Overall Sector Value');
        })
    }

    function selectSector() {
      var activeSector = $('#sector-filter').val();
      $('#sector-trades-table').children('tbody').children('tr').each(function(idx,row) {
        var stockSector = $(row).children('td.stock-name').data('sector');
        // console.log(stockSector);
        if (stockSector === activeSector) {
          $(row).removeClass('hide');
        } else {
          $(row).addClass('hide');
        }
      })
    }

    function renderSectorOverviewChart(container, seriesData) {
        var options = {
          colors: ["#512da8","#283593","#ad1457","#1976d2","#4fc3f7","#009688","#757575","#212121"],
          chart: {
              type: 'bar'
          },
          title: {
              text: "Total Holdings By Sector",
              align: 'left',
              style: {
                color: "#009688",
                fontSize: "1.2rem"
              }
          },
          xAxis: {
              labels: {
                enabled: false
              },
              tickLength:0,
              categories: ["Sector Breakdown"]
          },
          yAxis: {
              min: 0,
              gridLineWidth:0,
              endOnTick:false,
              labels: {
                enabled: false
              },
              title: {
                text: null
              },
              minorGridLineColor: '#C5EEFA'
          },
          legend: {
              reversed: true,
              itemStyle: {
                fontSize: "10px"
              },
              labelFormatter: function() {
                var valData = '$'+ Math.floor(this.yData[this.yData.length - 1]).toLocaleString();
                return this.name + " " + valData;
              },
              itemWidth:240
          },
          plotOptions: {
              series: {
                  stacking: 'normal',
                  dataLabels: {
                    enabled: true,
                    formatter: formatPct
                  }
              }
          },
          series: []
        };

        var total_value = 0;
        $.each(seriesData, function(key, value) {
          var s = {
            name: key,
            data: [value],
            pointWidth: 100
          };
          total_value += value;
          options.series.push(s);
        })

        options.yAxis.max = Math.floor(total_value);
        console.log(total_value);

        function formatPct() {
          var pcnt = (this.y/total_value) * 100;
          return Highcharts.numberFormat(pcnt)+"%";
        };

        container.highcharts(options);        
    }
})
