$(function() {
	$("#all-stocks-tab").find('select').material_select();
	$("#all-stocks-tab").find(".select-wrapper").css('width','60px')
	var portfolioTableData = $('#all-stocks-tab tbody');
	var totalBuySum;
	var totalSellSum;

	calculateTotalTradeValue();

	function calculateTotalTradeValue() {
		totalBuySum = 0;
		totalSellSum = 0;
		var cash = $('#all-stocks-tab').find('.cash').data("cash");

		var validateRow = function(stockRow, tradeType, numberOwned, numberTrading, sharePrice) {
			var button = $("#all-stocks-tab button");
				button.removeClass('disabled');
				button.text('Checkout');

			if (sharePrice === 0) $(stockRow).addClass('hide');

			$(stockRow).removeClass('red');
			var valid = true;

			if (tradeType === 'BUY') {
				if (cash < totalBuySum) {
					valid = false;
				}
			} else {
				if (numberOwned < numberTrading) {
					valid = false;
				}
			}

			if (!valid) {
				$(stockRow).addClass('red lighten-1');
					button.addClass('disabled');
					button.text('Disabled');
			}
		}

	  	portfolioTableData.children().each(function(idx,stockRow) {
	  		var numberOwned = parseInt($(stockRow).children('td.shares-number').text());
			var numberTrading = parseInt($(stockRow).children('td.trade-quantity').children('input').val());
			// Validate that the number can't be less than 0
			if (numberTrading < 0 || isNaN(numberTrading)) numberTrading = 0;

			var sharePrice = parseFloat($(stockRow).children('td.stock-price').text());
			if (isNaN(sharePrice)) sharePrice = 0;
			var tradeType = $(stockRow).children('td.trade-type').find('input').val();
			var totalValue = numberTrading * sharePrice;
			var subTotal = (sharePrice * numberTrading).toFixed(2);
			$(stockRow).children('.sub-total').text('$' + subTotal.toLocaleString());

			if (tradeType === 'BUY') {
				// Validate that the user has enough money.
				totalBuySum += totalValue;
				validateRow(stockRow, tradeType, numberOwned, numberTrading, sharePrice);
			} else {
				// Validate that user can't short.
				totalSellSum += totalValue;
				validateRow(stockRow, tradeType, numberOwned, numberTrading, sharePrice);
			}
		});

	  	var equity = $('#all-stocks-tab').find('.equity').data("equity");
	  	var value = $('#all-stocks-tab').find('.value').data("value");
	   	var netCash = totalSellSum - totalBuySum;

	    $('.all-stocks-checkout').find('.buyingMoney').text("$"+ totalBuySum.toLocaleString());
	    $('.all-stocks-checkout').find('.sellingMoney').text("$"+ totalSellSum.toLocaleString());
	    $('.all-stocks-checkout').find('.netMoney').text("$"+ netCash.toLocaleString());
		$('.all-stocks-checkout').find('.adjustedCash').text("$"+ (cash + netCash).toLocaleString());
		$('.all-stocks-checkout').find('.adjustedEquity').text("$"+ (equity - netCash).toLocaleString());
	}

	$('#all-stocks-tab tbody').on('keydown', '.trade-quantity > input', calculateTotalTradeValue);
	$('#all-stocks-tab tbody').on('keyup', '.trade-quantity > input', calculateTotalTradeValue);
	$('#all-stocks-tab tbody').on('change', '.trade-type', calculateTotalTradeValue);
	$('#all-stocks-tab tbody').on('change','.trade-quantity > input', calculateTotalTradeValue);

	$("#all-stocks-tab form").on('submit', function(e) {
		var button = $("#all-stocks-tab button");
		if ($(button).hasClass('disabled')) {
			e.preventDefault();
		}
	});
});
$(function() {
  if ($('.stock-side-bar').length) {
    var allStocks;
    var allDailyQuotes;

    $.ajax({
      url: '/api/stocks',
      data: {'request_type': 'latest_quotes'},
      contentType: 'json',
      success: function (json) {
        allStocks = json;
        renderStockBar(allStocks);

        // After they're rendered, grab the json for spark lines
        $.ajax({
          url: '/api/stocks',
          data: {'request_type': 'daily_quotes', 'limit': 10},
          contentType: 'json',
          success: function (json) {
            allDailyQuotes = json;
            createSparkTemplates(allDailyQuotes);
          }
        });
      }
    });

    var hbsStockSource = $('#stock-quote-hbs').html();
    var stockTemplate = Handlebars.compile(hbsStockSource);
    var hbsSparkSource = $('#stock-spark-hbs').html();
    var sparkTemplate = Handlebars.compile(hbsSparkSource);
    var timer;


    $('.stock-side-bar')
      .on('keyup', 'input', function() {
        $(".stock-quote").removeClass("active");
        var searchTerm = $(this).val();
        if (searchTerm === "") {
          $(".stock-quote").addClass("active");
          return false;
        }
        // ensure that the search term is alphanumeric before creating
        // regex based on the search
        var alphaNum = new RegExp(/^\w+$/);
        if (!alphaNum.test(searchTerm)) return false;

        var re = new RegExp(searchTerm, "i");
        allStocks.forEach(function(stock) {
          if (re.test(stock.ticker) || re.test(stock.name) || re.test(stock.sector)) {
            $('.stock-quote[data-ticker="'+stock.ticker+'"]').addClass('active');
          }
        });

      })

    function renderStockBar(stocks) {
      stocks = stocks.filter(function(n){ return n.latest_price != undefined });
      stocks.sort(function(a, b) {
        return a.ticker > b.ticker;
      });
      
      $.each(stocks, function(idx, stock) {
        var contextStock = {
          ticker: stock.ticker,
          price: stock.latest_price,
          name: stock.name,
        };
        var stockHtml = $(stockTemplate(contextStock));
        stockHtml.appendTo('.stock-quote-area');

        stockHtml.tooltip({delay: 50});
      })
    }

    $(".stock-side-bar").on('mouseenter', '.stock-quote', function() {
      var ticker = $(this).data('ticker');
      var name = $(this).data('name');
      var container = $('#'+$(this).data('tooltip-id')).find('.chart');
      if (container.text() === '') {
        var dataArray = [];

        $.each(allDailyQuotes[ticker], function(idx, quote) {
          var date = new Date(quote.date);
          dataArray.push([Date.UTC(date.getFullYear(), date.getMonth(), date.getDate()), quote.close_price]);
        });

        renderSparkChart(dataArray, container, ticker, name);
      }
    })


    function createSparkTemplates(daily_quotes) {
      $.each(daily_quotes, function(ticker, quotes) {
        var stockHtml = $('.stock-quote[data-ticker="'+ticker+'"]');
        var stockTooltip = $('#'+stockHtml.data('tooltip-id')+' span');
        stockTooltip.html($(sparkTemplate()));
      });
    }

    function renderSparkChart(chartArray, container, ticker, name) {
      container.highcharts('StockChart', {
        rangeSelector: {
          selected: 1,
          inputEnabled: false,
          buttonTheme: {
              visibility: 'hidden'
          },
          labelStyle: {
              visibility: 'hidden'
          }
        },
        plotOptions: {
          area: {
            fillColor: {
              linearGradient: {
                x1: 0,
                y1: 0,
                x2: 0,
                y2: 1
              },
              stops: [
                [0, Highcharts.getOptions().colors[0]],
                [1, Highcharts.Color(Highcharts.getOptions().colors[0]).setOpacity(0).get('rgba')]
              ]
            },
            lineWidth: 1,
            threshold: null,
            borderWidth: 0,
          }
        },
        title : {
          text : ticker
        },
        subtitle : {
          text : name
        },
        scrollbar : {
            enabled : false
        },
        navigator : {
            enabled : false
        },
        series : [{
          type: 'area',
          name: "",
          data : chartArray,
        }]
      })
    }
  }

  return false;
})
